import React, { Component } from 'react';
import logo from './mallard.svg';
import './App.css';
import Nav from './components/Nav/Nav';
import TitleBar from './components/TitleBar/TitleBar';
import Footer from './components/Footer/Footer';
import Results from './components/AppPages/ResultPage';
import Input from './components/AppPages/InputPage';

class App extends Component {
  constructor(props) {}

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <Nav logo={logo} />
          <TitleBar title={this.state.title} setTitle={this.setTitle} />
        </header>
        <main id="entry-container">
          {/* <Results /> */}
          <Input />
        </main>
        <Footer />
      </div>
    );
  }
}

export default App;
